  render: () => {
    const [scrollOnMount, setScrollOnMount] = useState(false);
    const [scrollIndex, setScrollIndex] = useState(100);
    const [smooth, setSmooth] = useState(true);
    const [hydrated, setHydrated] = useState(false);
    const ref = useRef<HTMLDivElement>(null);
    useLayoutEffect(() => {
      if (!ref.current) return;
      if (!hydrated) {
        ref.current.innerHTML = renderToString(<AppScrollOnMount />);
      } else {
        hydrateRoot(ref.current, <AppScrollOnMount scrollOnMount={scrollOnMount} scrollToIndex={scrollIndex} smooth={smooth} />);
      }
    }, [hydrated]);
    return <div style={{
      height: "100vh",
      display: "flex",
      flexDirection: "column"
    }}>
        <div style={{
        display: "flex",
        justifyContent: "space-between",
        padding: 8
      }}>
          <button disabled={hydrated} onClick={() => {
          setHydrated(true);
        }}>
            hydrate
          </button>
          <div style={{
          display: "flex",
          alignItems: "center",
          gap: 10
        }}>
            <label>On hydration:</label>
            <label>
              <input type="checkbox" checked={scrollOnMount} onChange={() => {
              setScrollOnMount(prev => !prev);
            }} />
              scroll to index
            </label>
            <input type="number" value={scrollIndex} onChange={e => {
            setScrollIndex(Number(e.target.value));
          }} />
            <label>
              <input type="checkbox" checked={smooth} onChange={() => {
              setSmooth(prev => !prev);
            }} />
              smooth
            </label>
          </div>
        </div>
        <div ref={ref} style={{
        flex: 1
      }} />
      </div>;
  }
